import React, { Fragment } from "react";
import { Content } from "../Components/Content";
import { Button, Breadcrumb} from "react-bootstrap";

function LecturerCourseDetail() {
    return (
        <Fragment>
            <Content>
                <div id="lecturerCourseDetail" className="d-flex" style={{ padding: "2rem" }}>
                    <div className="courseSection" style={{ width: "70%" }}>
                        <h3 className="my-4" style={{ fontWeight: "600" }}>Intro To Software Engineering</h3>
                        <Breadcrumb>
                            <Breadcrumb.Item href="#" style={{color: "black"}}>Dashboard</Breadcrumb.Item>
                        </Breadcrumb>
                    </div>
                    <div className="lessonSection" style={{ width: "30%" }}>
                        <div className="lessonTitleGroup d-flex justify-content-between align-items-center">
                            <h4 className="my-4" style={{ fontWeight: "600" }}>Lessons</h4>
                            <Button className="d-flex justify-content-center align-items-center" style={{height: "36px"}}>New Lesson</Button>
                        </div>
                    </div>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerCourseDetail;
